import React from 'react';
import Link from 'next/link';

const layaout = (props) => {
    return (
        <>
            <h1>Header prro</h1>
            <nav>
                <Link href = "/">Inicio</Link>
                <Link href = "/medicinales">Inicio</Link>
            </nav>
            <main>
                {props.children}
            </main>
        </>
    );
};

export default layaout;
